IF OBJECT_ID('dbo.proc_transform_141', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_141;
GO
CREATE PROCEDURE dbo.proc_transform_141
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_141
    SET payload = LEFT(payload, 1000) + N'|V4-141|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_141;
END
GO
IF OBJECT_ID('dbo.audit_v4_141', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_141 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_141;
GO

CREATE INDEX IDX_staging_141_payload ON dbo.staging_table_141 (id);
